ything in the last 20 years. Some of his songs have recently been re-discovered by todays cult vinyl collectors and reached cult classic status. The main theme from the French adult movie \"Hotel damour\" has become something of an underground lounge hit as it was re-released on UK label Repap. Trafalgars obscure music for the Asian 70s film \"Kung-fu girl\" was used on a TV and radio commercial for JC jeans that was awarded as \"the best song from a commercial 2001\" and the clothing has noticed a 20% increase in sales during the peoriod of the campaign. Not bad for a song with explicit political lyrics sung on chineese in mid 70s. \"','Teenage Crimewave','Bobby Trafalgar','12-teenage crimewave.mp3','780166bec13e1f4c24f84983d70bf6be',NULL,'2013-02-26 00:00:00',1,24,'2013-02-26 09:43:23','2015-10-16 05:45:04','bobby-trafalgar-teenage-crimewave',''),(3417,'Trs peu d\'infos sur cet obscur groupe allemand des annes \'90 qui a sorti trois albums uniquement sur K7...','Chauvinist','Comahon Kidney Virus','Chauvinist.mp3','df139887c2ae69755d469681a32d4a9c',NULL,'2013-02-26 00:00:00',1,32,'2013-02-26 12:26:18','2015-10-16 05:45:05','comahon-kidney-virus-chauvinist','http://www.discogs.com/Comahon-Kidney-Virus-Headkick/release/2630726'),(3418,'Les poissons chats mangent les pigeons et le capitaine Iglo vend du poulet sur son bateau.','Le Poisson Chat','Alain Syhlvain','ALAIN_SYHLVAIN_-_LE_POISSON_CHAT-1xO0R7lXMFc.mp3','e041337ce161d6f2896c3b99b8396f8f',NULL,'2013-02-26 00:00:00',1,1,'2013-02-26 12:59:11','2015-10-16 05:45:05','alain-syhlvain-le-poisson-chat',''),(3419,'Je me souviens d\'une magnifique reprise de [Bohemian Rhapsody](https://www.youtube.com/watch?v=MNw8wGakx0w/) par Weasel Walter. \r\n\r\nSinon il fait aussi batteur fou.','Interface','Weasel Walter Mary Halvorson Peter Evans ','08 - Interface.mp3','7cac2b6b6df3b7c54bdb47f407932197',NULL,'2013-02-26 00:00:00',1,20,'2013-02-26 13:29:17','2015-10-16 05:45:06','weasel-walter-mary-halvorson-peter-evans-interface','